import React, { useState } from "react";
import Hello from "./module";
import Card from "./Card";
import Temp from "./Temp";

const stateChange = (number) => {
   number += 100;
   console.log(number);
};

const App = () => {
   let temp = "hello";
   const [number, setNumber] = useState(temp);
   const stateChange = () => {
      setNumber("changed");
      if (number == "changed") {
         setNumber("hello");
      }
      console.log(number);
   };
   return (
      <div>
         <Temp>
            <Card number="45"></Card>
            <Hello item="hello"></Hello>
         </Temp>
         <button onClick={stateChange}>Click</button>
      </div>
   );
};

export default App;
